import React, { useState } from "react";
import "./login.css";
import { GroupAdd, School } from "@mui/icons-material";
import Modal from "react-modal";
import Button from "react-bootstrap/Button";
import "bootstrap/dist/css/bootstrap.min.css";

export default function Login() {
  const [modalIsOpen, setModalIsOpen] = useState(false);

  const handleSubmission = () => {
    let datas = {
      name: "anshika",
      email: "abc@gmail.com",
      password: "12345",
    };
    // let data = JSON.stringify(datas);
    fetch("http://localhost:8080/adduser", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        email: "anshika@gmail.com",
        password: "check",
        name: "anshika",
      }),
    }).then((response) => {
      console.log(response);
    });
    // .then((response) => response.json())
    // .then((data) => {
    //   console.log("success");
    // })
    // .catch((err) => {
    //   console.log(err);
    // });
  };

  return (
    <div className="login">
      <div className="login-buttons" style={{ zIndex: "0" }}>
        <div className="loginheading">
          <span className="heading">Sign In As</span>
        </div>
        <div className="loginbuttons">
          <div className="LoginButton col-md-12 text-center">
            <Button
              variant="outline-primary"
              size="lg"
              className="loginbuttonadmin"
              onClick={() => {
                setModalIsOpen(true);
              }}
            >
              <GroupAdd className="loginIcon" sx={{ fontSize: "35px" }} />
              Admin
            </Button>{" "}
            <Button
              variant="outline-secondary"
              size="lg"
              className="loginbuttonstudent"
            >
              <School className="loginIcon" sx={{ fontSize: "35px" }} />
              Student
            </Button>{" "}
          </div>
        </div>
      </div>

      <Modal
        className="shadow bd-example-modal-sm modellogin"
        id="example-modal-sizes-title-sm"
        tabindex="-1"
        role="dialog"
        isOpen={modalIsOpen}
        onRequestClose={() => setModalIsOpen(false)}
        style={{ zIndex: "1" }}
      >
        <div className="modal-dialog" role="document">
          <div className="modal-content text-center">
            <div className="modal-footer">
              <button
                type="button"
                onClick={() => setModalIsOpen(false)}
                className="close"
                data-dismiss="modal"
                aria-label="Close"
              >
                <span aria-hidden="true">&times;</span>
              </button>
              <h5 className="modal-title model-heading col-md-12">
                Login as a Admin
              </h5>
            </div>
            <div className="modal-body">
              <div className="login">
                <h1>Login</h1>
                <input
                  type="text"
                  name="email"
                  placeholder="Enter your Email"
                ></input>
                <input
                  type="password"
                  name="password"
                  placeholder="Enter your Password"
                ></input>
                <div className="button">Login</div>
                <div>or</div>
                <div className="button">Register</div>
              </div>
            </div>
          </div>
        </div>
      </Modal>
    </div>
  );
}
